import {Center, Flex, FormControl} from "@chakra-ui/react";
import InputField from "../InputField";

const Form = () => {
  return(
    <Flex h="100vh" align="center" justify="">
      <FormControl align="center" justify="center" flexDirection="column">
        <InputField label="Nome"/>
        <InputField label="E-mail"/>
        <InputField label="CPF" />
      </FormControl>
    </Flex>
  );
}

export default Form;
